    y[18] = x[18]*15.035060*XWinv; 
    y[19] = x[19]*29.018520*XWinv; 
    y[20] = x[20]*30.026490*XWinv; 
    y[21] = x[21]*31.034460*XWinv; 
    y[22] = x[22]*28.010550*XWinv; 
