        Kc_s[150*npt+i] = exp((g_RT[4*npt+i] + g_RT[9*npt+i]) - (g_RT[3*npt+i] + g_RT[31*npt+i]));
        Kc_s[151*npt+i] = refC * exp((g_RT[4*npt+i] + g_RT[10*npt+i]) - (g_RT[9*npt+i] + g_RT[18*npt+i] + g_RT[29*npt+i]));
        Kc_s[152*npt+i] = exp((g_RT[4*npt+i] + g_RT[10*npt+i]) - (g_RT[19*npt+i] + g_RT[26*npt+i]));
