        wdot[33*npt+i] -= qdot;
        wdot[36*npt+i] += qdot;

        /*reaction 170: C6H5 + HCO <=> C6H5CHO */
        phi_f = sc[19*npt+i]*sc[32*npt+i];
        k_f = k_f_s[169*npt+i];
        q_f = phi_f * k_f;
        phi_r = sc[36*npt+i];
        Kc = Kc_s[169*npt+i];
        k_r = k_f / Kc;
        q_r = phi_r * k_r;
        qdot = q_f - q_r;
        wdot[19*npt+i] -= qdot;
        wdot[32*npt+i] -= qdot;
        wdot[36*npt+i] += qdot;

        /*reaction 171: C6H5CHO <=> C6H5CO + H */
        phi_f = sc[36*npt+i];
        k_f = k_f_s[170*npt+i];
        q_f = phi_f * k_f;
