    /* forward */
    phi_f = pow(sc[11], 2.000000);
    k_f = 1.0000000000000002e-06 * 111000000000000
                * exp(-0.37 * tc[0] - 0.50321666580471969 * (0) * invT);
    dlnkfdT = -0.37 * invT + 0.50321666580471969 *  (0)  * invT2;
